import PhoneDrop from "./phoneDrop";
import SocDrop from "./socDrop";

function DropDown({turn}){


    const turnDisplay = () => {
        if(turn === ""){
            return "";
        }
        else if(turn ==="Phone"){
            return( setTimeout(()=><PhoneDrop/>,1500));
        }
        else if(turn === "Soc")
        { return (<SocDrop />);
        }
    }

    return(
        <div id={`dropDown${turn}`}> 
            {turnDisplay()}      
        </div>
    )

//end of component
};

export default DropDown;
